import styled from 'styled-components'

export const Container = styled.main`
  padding-top: 78px;
  padding-bottom: 78px;
`

export const Wrapper = styled.div`
  max-width: 1200px;
  margin-left: auto;
  margin-right: auto;
  padding-left: 16px;
  padding-right: 16px;
`
